// 物理演算系で、立方体／カプセルを力（applyFoce)で動かす例(2)：カーレース：comゴーストカー版
// - LiearDampingで操作性を向上
//   - パラメータ調整次第でグリップ／ドリフトに
// - カーレースゲームっぽく仕上げる
//   - スタートゴールでタイム計測
//   - 自身の走行データを記録してゴーストカー表示に
//   - ゴーストカーは実体がないメッシュ表示のみ
const createScene = function () {
    const scene = new BABYLON.Scene(engine);

    // 物理エンジンを有効にする
    const gravityVector = new BABYLON.Vector3(0, -1.5, 0);
    const physicsPlugin = new BABYLON.HavokPlugin();
    scene.enablePhysics(gravityVector, physicsPlugin);

    const camera = new BABYLON.FollowCamera("FollowCam", new BABYLON.Vector3(0, 10, -10), scene);
    camera.radius = 10;
    camera.heightOffset = 2;
    camera.rotationOffset = 180;
    camera.cameraAcceleration = 0.05;
    camera.maxCameraSpeed = 30;
    camera.warningEnable = false;
    camera.attachControl(canvas, true);
    camera.inputs.clear(); // カーソルキーでカメラ操作させないようにする
    let icamera = 0;

    const light = new BABYLON.HemisphericLight("light", new BABYLON.Vector3(0, 1, 0), scene);
    light.intensity = 0.7;

    // 地面を設定する
    const groundMesh = BABYLON.MeshBuilder.CreateGround("ground", { width: 200, height: 150 }, scene);
    // テクスチャを張り付ける
    var matgnd = new BABYLON.StandardMaterial("mat1", scene);
    // GroundPlayer用
//    matgnd.diffuseTexture = new BABYLON.Texture("https://raw.githubusercontent.com/fnamuoo/webgl/main/042/pic/BoxySVG_test1_3_400x300.png", scene);
    // ローカル環境用
    matgnd.diffuseTexture = new BABYLON.Texture("textures/BoxySVG_test1_3_400x300.png", scene);
    groundMesh.material = matgnd;

    // 地面に摩擦係数、反射係数を設定する
    var groundAggregate = new BABYLON.PhysicsAggregate(groundMesh, BABYLON.PhysicsShapeType.BOX, { mass: 0, friction: 0.001, restitution:0.01}, scene);

    // 落下防止用に壁をつくる
    {
        let geolist = [[0, 1, 75, 200, 1.5, 1],
                       [0, 1, -75, 200, 1.5, 1],
                       [100, 1, 0, 1, 1.5, 150],
                       [-100, 1, 0, 1, 1.5, 150],
                      ];
        for (let [px,py,pz,sx,sy,sz] of geolist) {
            const trgMesh = BABYLON.MeshBuilder.CreateBox("wall", { width: sx, height: sy, depth: sz }, scene);
            let mat = new BABYLON.StandardMaterial("mat", scene);
            mat.emissiveColor = BABYLON.Color3.Blue();
            trgMesh.material = mat;
            var trgAgg = new BABYLON.PhysicsAggregate(trgMesh, BABYLON.PhysicsShapeType.BOX, { mass: 0, restitution:0.05}, scene);
            trgMesh.physicsBody.disablePreStep = true;
            trgMesh.position = new BABYLON.Vector3(px, py, pz);
            trgMesh.physicsBody.disablePreStep = false;
        }
    }


    // 自機（立方体）
    const myMesh = BABYLON.MeshBuilder.CreateBox("my", { size: 2 }, scene);
    // 下記 モード(imode)ごとに応じたmaterial
    let myMat1 = new BABYLON.StandardMaterial("mymat1", scene);
    let myMat2 = new BABYLON.GradientMaterial("mymat2", scene);
    myMat2.topColor = new BABYLON.Color3(0.9, 0.9, 0.9);
    myMat2.bottomColor = new BABYLON.Color3(0.5, 0.5, 0.5);
    myMat2.offset = 1.5;
    myMat2.scale = 3;
    let myMat3 = new BABYLON.GridMaterial("mymat3", scene);
    myMesh.material = myMat1;

    var myAgg = new BABYLON.PhysicsAggregate(myMesh, BABYLON.PhysicsShapeType.BOX, { mass: 1.0, friction: 0.001, restitution:0.05}, scene);
    myAgg.body.setMotionType(BABYLON.PhysicsMotionType.DYNAMIC);
    myAgg.body.setPrestepType(BABYLON.PhysicsPrestepType.TELEPORT);

    // ------------------------------
    // 直線移動時の抵抗            ブレーキ時の抵抗        加速
    let linearDumpNmr = 3; let linearDumpBrk = 0.99; let vAcc = 18;  // グリップ
    let imode = 0, nmode = 3;
    function changeMode(imode) {
        if (imode == 0) {
            // グリップ
            console.log("mode:grip")
            linearDumpNmr = 3; linearDumpBrk = 0.99; vAcc = 18;
            myMesh.material = myMat1;
        } else if (imode == 1) {
            // ドリフト
            console.log("mode:drift")
            linearDumpNmr = 0.5; linearDumpBrk = 1; vAcc = 4;
            myMesh.material = myMat2;
        } else {
            // 滑りやすい（スノー、ダートコース）
            console.log("mode:slippy")
            linearDumpNmr = 0.3; linearDumpBrk = 1; vAcc = 3.5;
            myMesh.material = myMat3;
        }
        myMesh.physicsBody.setLinearDamping(linearDumpNmr);
    }

    changeMode(imode);

    myMesh.physicsBody.setAngularDamping(2);

    myMesh.position = new BABYLON.Vector3(-50, 5, 50);
    myMesh.rotationQuaternion = new BABYLON.Quaternion.FromEulerAngles(0, 1.5, 0);
    camera.lockedTarget = myMesh;

    // ターゲットにローカル軸の表示を追加 (赤:x軸, 緑:y軸, 青:z軸)
    const localAxes = new BABYLON.AxesViewer(scene, 1.0);
    localAxes.xAxis.parent = myMesh;
    localAxes.yAxis.parent = myMesh;
    localAxes.zAxis.parent = myMesh;

    let keyAction = {forward:0, back:0, right:0, left:0, jump:0, brake:0, reset:0, resetCooltime:0};

    // https://www.crossroad-tech.com/entry/babylonjs-translate-keyinput
    var map ={}; //object for multiple key presses
    scene.actionManager = new BABYLON.ActionManager(scene);
    scene.actionManager.registerAction(new BABYLON.ExecuteCodeAction(BABYLON.ActionManager.OnKeyDownTrigger, function (evt) {								
        map[evt.sourceEvent.key] = evt.sourceEvent.type == "keydown"; 
    }));
    scene.actionManager.registerAction(new BABYLON.ExecuteCodeAction(BABYLON.ActionManager.OnKeyUpTrigger, function (evt) {								
        map[evt.sourceEvent.key] = evt.sourceEvent.type == "keydown";
    }));
    scene.registerAfterRender(function() {	
        keyAction.forward = 0;
        keyAction.back = 0;
        if ((map["ArrowUp"] || map["w"])) {
            keyAction.forward = 1;
        } else if ((map["ArrowDown"] || map["s"])) {
            keyAction.back = 1;
        }
        keyAction.left = 0;
        keyAction.right = 0;
        if ((map["ArrowLeft"] || map["a"])) {
            keyAction.left = 1;
        } else if ((map["ArrowRight"] || map["d"])) {
            keyAction.right = 1;
        }
        keyAction.brake = 0;
        if (map["b"]) {
            keyAction.brake = 1;
            myMesh.physicsBody.setLinearDamping(linearDumpBrk);
        }
        keyAction.jump = 0;
        if (map[" "]) {
            keyAction.jump = 1;
        }
        if (map["r"]) {
            keyAction.reset = 1;
        }
        if (keyAction.resetCooltime) {
            --keyAction.resetCooltime;
        } else {
            if (map["c"]) {
                keyAction.resetCooltime = 120;
                icamera = (icamera+1) % 4;
                if (icamera == 0) {
                    // 後ろから追っかける（バードビュー
                    camera.radius = 10;
                    camera.heightOffset = 2;
                    camera.cameraAcceleration = 0.05;
                    camera.maxCameraSpeed = 30;
                } else if (icamera == 1) {
                    // ちょい遅れて／離れて追っかける（バードビュー遠方
                    camera.radius = 15;
                    camera.heightOffset = 3;
                    camera.cameraAcceleration = 0.005;
                    camera.maxCameraSpeed = 10;
                } else if (icamera == 2) {
                    // 上空（トップビュー
                    camera.radius = 0.1;
                    camera.heightOffset = 20;
                    camera.cameraAcceleration = 0.9;
                    camera.maxCameraSpeed = 30;
                } else if (icamera == 3) {
                    // 正面（フロントビュー／ドライバーズビュー
                    camera.radius = 0.1;
                    camera.heightOffset = 0;
                    camera.cameraAcceleration = 0.9;
                    camera.maxCameraSpeed = 30;
                }
            } else if (map["h"]) {
                keyAction.resetCooltime = 120;
                if (guiLabelRect.isVisible) {
                    guiLabelRect.isVisible = false;
                } else {
                    guiLabelRect.isVisible = true;
                }
            } else if (map["g"]) {
                keyAction.resetCooltime = 120;
                if (bGhostEnable) {
                    gcariframe1 = -1;
                    gcariframe2 = -1;
                    gcariframe3 = -1;
                    gcarMesh1.position = new BABYLON.Vector3(0, -2, 0);
                    gcarMesh2.position = new BABYLON.Vector3(0, -2, 0);
                    gcarMesh3.position = new BABYLON.Vector3(0, -2, 0);
                    console.log("ghost off")
                } else {
                    console.log("ghost ON")
                }
                bGhostEnable = !bGhostEnable;
            } else if (map["m"]) {
                keyAction.resetCooltime = 60;
                imode = (imode+1) % nmode;
                changeMode(imode);
            } else if (map["z"]) {
                keyAction.resetCooltime = 240;
                outputRunningData();
            }
        }
    });

    // ghost car に関するデータ
    let bGhostEnable = true; // "g"キーの on/off
    let bOnRecord = false;
    let gcarPosiList = [];   // 一時記録先（座標[x,y,z]とY軸回転）
    let gcarPosiList1 = [];  // ベストレコード
    let gcariframe1 = -1;    // 再生時のindex
    const gcarMesh1 = BABYLON.MeshBuilder.CreateBox("ghost", { size: 2 }, scene);
    // var gcarAgg1 = new BABYLON.PhysicsAggregate(gcarMesh1, BABYLON.PhysicsShapeType.BOX, { mass: 3.0, friction: 0.01, restitution:0.05}, scene);
    // gcarAgg1.body.setMotionType(BABYLON.PhysicsMotionType.ANIMATED);
    // gcarAgg1.body.setPrestepType(BABYLON.PhysicsPrestepType.TELEPORT);
    gcarMesh1.material = new BABYLON.StandardMaterial("gc_mat");
    gcarMesh1.material.alpha = 0.4;
    gcarMesh1.material.diffuseColor = BABYLON.Color3.Red();
    gcarMesh1.position = new BABYLON.Vector3(0, -2, 0);

    let gcarPosiList2 = [];
    let gcariframe2 = -1;
    const gcarMesh2 = BABYLON.MeshBuilder.CreateBox("ghost", { size: 2 }, scene);
    // var gcarAgg2 = new BABYLON.PhysicsAggregate(gcarMesh2, BABYLON.PhysicsShapeType.BOX, { mass: 3.0, friction: 0.01, restitution:0.05}, scene);
    // gcarAgg2.body.setMotionType(BABYLON.PhysicsMotionType.ANIMATED);
    // gcarAgg2.body.setPrestepType(BABYLON.PhysicsPrestepType.TELEPORT);
    gcarMesh2.material = new BABYLON.StandardMaterial("gc_mat");
    gcarMesh2.material.alpha = 0.4;
    gcarMesh2.material.diffuseColor = BABYLON.Color3.Green();
    gcarMesh2.position = new BABYLON.Vector3(0, -2, 0);

    let gcarPosiList3 = [];
    let gcariframe3 = -1;
    const gcarMesh3 = BABYLON.MeshBuilder.CreateBox("ghost", { size: 2 }, scene);
    // var gcarAgg3 = new BABYLON.PhysicsAggregate(gcarMesh3, BABYLON.PhysicsShapeType.BOX, { mass: 3.0, friction: 0.1, restitution:0.05}, scene);
    // gcarAgg3.body.setMotionType(BABYLON.PhysicsMotionType.ANIMATED);
    // gcarAgg3.body.setPrestepType(BABYLON.PhysicsPrestepType.TELEPORT);
    gcarMesh3.material = new BABYLON.StandardMaterial("gc_mat");
    gcarMesh3.material.alpha = 0.4;
    gcarMesh3.material.diffuseColor = BABYLON.Color3.Blue();
    gcarMesh3.position = new BABYLON.Vector3(0, -2, 0);

    function outputRunningData() {
        console.log("1.size=", gcarPosiList1.length);
        console.log("2.size=", gcarPosiList2.length);
        console.log("3.size=", gcarPosiList3.length);

        if (0) {
            // type=1: テキスト形式(桁落ち)、数値の精度は小数点第１位まで（出力は10倍にする。小数点表示がもったいない）
            //   type5 < type1 < type4 なサイズだが、数値の精度が一番粗い（うごきがガタガタする）
            console.log("type1");
            for (let tmplist2 of [gcarPosiList1, gcarPosiList2, gcarPosiList3]) {
                if (tmplist2.length == 0) {
                    console.log("empty, skip");
                    continue;
                }
                let tmplist = "[";
                for (let [vposi,roty] of tmplist2) {
                    tmplist += Math.floor((vposi.x)*10) + ",";
                    tmplist += Math.floor((vposi.y)*10) + ",";
                    tmplist += Math.floor((vposi.z)*10) + ",";
                    tmplist += Math.floor(roty*10) + ",";
                }
                tmplist += "]";
                console.log(tmplist);
            }
        }

        if (0) {
            // type=2: 無圧縮
            console.log("type2");
            for (let tmplist2 of [gcarPosiList1, gcarPosiList2, gcarPosiList3]) {
                if (tmplist2.length == 0) {
                    console.log("empty, skip");
                    continue;
                }
                tmplist = [];
                for (let [vposi,roty] of tmplist2) {
                    tmplist.push(vposi.x);
                    tmplist.push(vposi.y);
                    tmplist.push(vposi.z);
                    tmplist.push(roty);
                }
                let jstr = JSON.stringify(tmplist);
                console.log(jstr);
            }
        }

        if (0) {
            // type=4: Base64 (type5の約２倍)
            console.log("type4");
            for (let tmplist2 of [gcarPosiList1, gcarPosiList2, gcarPosiList3]) {
                if (tmplist2.length == 0) {
                    console.log("empty, skip");
                    continue;
                }
                let tmplist = [];
                for (let [vposi,roty] of tmplist2) {
                    tmplist.push(vposi.x);
                    tmplist.push(vposi.y);
                    tmplist.push(vposi.z);
                    tmplist.push(roty);
                }
                tmplist = arrayToFloat32Array(tmplist);
                tmplist = float32ArrayToBase64(tmplist);
                console.log(tmplist);
            }
        }


        if (1) {
            // type=5: 圧縮(float16array) + Base64
            console.log("type5");
            for (let tmplist2 of [gcarPosiList1, gcarPosiList2, gcarPosiList3]) {
                if (tmplist2.length == 0) {
                    console.log("empty, skip");
                    continue;
                }
                let tmplist = [];
                for (let [vposi,roty] of tmplist2) {
                    tmplist.push(vposi.x);
                    tmplist.push(vposi.y);
                    tmplist.push(vposi.z);
                    tmplist.push(roty);
                }
                tmplist = arrayToFloat16Array(tmplist);
                tmplist = float32ArrayToBase64(tmplist);
                console.log(tmplist);
            }
        }

    }

    function inputRunningData() {
        gcarPosiList1 = [];
        gcarPosiList2 = [];
        gcarPosiList3 = [];
        let tmplist;
        if (0) {
            // type=1: テキスト(桁落ち)
            let tmplist = RUNDATA1_1;
            for (let i = 0; i < tmplist.length; ++i) {
                let vx = tmplist[i]/10; ++i;
                let vy = tmplist[i]/10; ++i;
                let vz = tmplist[i]/10; ++i;
                let roty = tmplist[i]/10;
                let v3 = new BABYLON.Vector3(vx, vy, vz);
                gcarPosiList1.push([v3, roty])
            }
        }
        if (0) {
            // type=4: 圧縮(float32array) + Base64 のデコード
            let tmplist = base64ToFloat32Array(RUNDATA1_4);
            for (let i = 0; i < tmplist.length; ++i) {
                let vx = tmplist[i]; ++i;
                let vy = tmplist[i]; ++i;
                let vz = tmplist[i]; ++i;
                let roty = tmplist[i];
                let v3 = new BABYLON.Vector3(vx, vy, vz);
                gcarPosiList1.push([v3, roty])
            }
        }
        if (1) {
            // type=5: 圧縮(float16array) + Base64 のデコード
            tmplist = base64ToFloat16Array(RUNDATA1_5);
            for (let i = 0; i < tmplist.length; ++i) {
                let vx = tmplist[i]; ++i;
                let vy = tmplist[i]; ++i;
                let vz = tmplist[i]; ++i;
                let roty = tmplist[i];
                let v3 = new BABYLON.Vector3(vx, vy, vz);
                gcarPosiList1.push([v3, roty])
            }
            if (RUNDATA2_5.length > 0) {
                tmplist = base64ToFloat16Array(RUNDATA2_5);
                for (let i = 0; i < tmplist.length; ++i) {
                    let vx = tmplist[i]; ++i;
                    let vy = tmplist[i]; ++i;
                    let vz = tmplist[i]; ++i;
                    let roty = tmplist[i];
                    let v3 = new BABYLON.Vector3(vx, vy, vz);
                    gcarPosiList2.push([v3, roty])
                }
            }
            if (RUNDATA3_5.length > 0) {
                tmplist = base64ToFloat16Array(RUNDATA3_5);
                for (let i = 0; i < tmplist.length; ++i) {
                    let vx = tmplist[i]; ++i;
                    let vy = tmplist[i]; ++i;
                    let vz = tmplist[i]; ++i;
                    let roty = tmplist[i];
                    let v3 = new BABYLON.Vector3(vx, vy, vz);
                    gcarPosiList3.push([v3, roty])
                }
            }
        }
        if (1) {
            // スターティンググリッドの代わりに
            // １番目のデータをスタート位置をかなり進ませるためスタート地点のデータをかなり削る
            // ２番目のデータをスタート位置を進ませるためスタート地点のデータを削る
            gcarPosiList1 = gcarPosiList1.slice(0, gcarPosiList1.length-100);
            gcarPosiList2 = gcarPosiList2.slice(0, gcarPosiList2.length-50);
        }

        if (0) {
            // ビギナー仕様
            // 時間差で遅れて出発するデータとする
            for (let i = 0; i < 120; ++i) {
                gcarPosiList1.push([new BABYLON.Vector3(0,0,0), 0]);
                gcarPosiList2.push([new BABYLON.Vector3(0,0,0), 0]);
                gcarPosiList3.push([new BABYLON.Vector3(0,0,0), 0]);
            }
        }
    }

    // 末尾にハードコードした走行データを読み込みゴーストカーのデータとする
    inputRunningData();

    const qRotR = BABYLON.Quaternion.FromEulerAngles(0, 0.02, 0);
    const qRotL = BABYLON.Quaternion.FromEulerAngles(0, -0.02, 0);
    scene.onBeforeRenderObservable.add(() => {
        if (bGhostEnable) {
            if (bOnRecord) {
                gcarPosiList.unshift([myMesh.position.clone(), myMesh.rotationQuaternion.toEulerAngles().y]);
                if (gcarPosiList.length > 10000) {
                    bOnRecord = false;  // 長時間記録の対策...約2:40後に強制停止
                    console.log("stop record. sorry.");
                }
            }
            // ghost car の表示
            if (gcariframe1 >= 0) {
                let [vposi, roty] = gcarPosiList1[gcariframe1];
                gcarMesh1.position = vposi;
                gcarMesh1.rotation.y = roty;
                --gcariframe1;
                if (gcariframe1 < 0){
                    gcarMesh1.position = new BABYLON.Vector3(0, -2, 0);
                    gcarMesh1.rotation.y = 0;
                }
            }
            if (gcariframe2 >= 0) {
                let [vposi, roty] = gcarPosiList2[gcariframe2];
                gcarMesh2.position = vposi;
                gcarMesh2.rotation.y = roty;
                --gcariframe2;
                if (gcariframe2 < 0){
                    gcarMesh2.position = new BABYLON.Vector3(0, -2, 0);
                    gcarMesh2.rotation.y = 0;
                }
            }
            if (gcariframe3 >= 0) {
                let [vposi, roty] = gcarPosiList3[gcariframe3];
                gcarMesh3.position = vposi;
                gcarMesh3.rotation.y = roty;
                --gcariframe3;
                if (gcariframe3 < 0){
                    gcarMesh3.position = new BABYLON.Vector3(0, -2, 0);
                    gcarMesh3.rotation.y = 0;
                }
            }
        }
        if (keyAction.forward) {
            let vdir = new BABYLON.Vector3(0 ,0, vAcc);
            let quat = myMesh.rotationQuaternion;
            vdir = vdir.applyRotationQuaternion(quat);
            let vForce = vdir.scale(2);
            myAgg.body.applyForce(vForce, myMesh.absolutePosition);
        } else if (keyAction.back) {
            let vdir = new BABYLON.Vector3(0 ,0, -vAcc);
            let quat = myMesh.rotationQuaternion;
            vdir = vdir.applyRotationQuaternion(quat);
            let vForce = vdir.scale(2);
            myAgg.body.applyForce(vForce, myMesh.absolutePosition);
        }
        if (keyAction.right) {
            let quat = myMesh.rotationQuaternion;
            myMesh.rotationQuaternion = qRotR.multiply(quat);
        } else if (keyAction.left) {
            let quat = myMesh.rotationQuaternion;
            myMesh.rotationQuaternion = qRotL.multiply(quat);
        }
        myMesh.physicsBody.setAngularVelocity(new BABYLON.Vector3(0, 0, 0)); // 回転を止める
        if (keyAction.jump) {
            myAgg.body.applyForce(new BABYLON.Vector3(0, 40, 0), myMesh.absolutePosition);
        }

        if (keyAction.reset) {
            // 姿勢を正す
            // クォータニオンからオイラー角を取得、方向（ヨー:z軸回転）だけを使い他は0として姿勢をリセットする
            keyAction.reset = 0;
            myAgg.body.applyForce(new BABYLON.Vector3(0, 40, 0), myMesh.absolutePosition);
            let eular = myMesh.rotationQuaternion.toEulerAngles()
            let quat = BABYLON.Quaternion.RotationYawPitchRoll(eular.y, 0, 0);
            myMesh.rotationQuaternion = quat;
            myMesh.physicsBody.setAngularVelocity(new BABYLON.Vector3(0, 0, 0)); // 回転を止める
        }

        if (pftime != null) {
            let pftimeEnd = performance.now();
            timeCur = Math.floor(pftimeEnd-pftime)/1000;
            dispTime(timeCur, timeBest);
        }
    });

    // スタート／ゴールラインでのタイム計測
    var triggerShapeExtents = new BABYLON.Vector3(3, 2, 10);
    let posiTriger = new BABYLON.Vector3(0.6, 1.1, 48);
    var triggerPhys = new BABYLON.PhysicsShapeBox(posiTriger, new BABYLON.Quaternion(), triggerShapeExtents, scene);
    const triggerMesh = BABYLON.MeshBuilder.CreateBox("triggerMesh", {width:3, height:2, depth:10}, scene);
    triggerMesh.material = new BABYLON.StandardMaterial("mat");
    triggerMesh.material.alpha = 0.7;
    triggerMesh.material.diffuseColor = BABYLON.Color3.Red();
    triggerPhys.isTrigger = true;

    var triggerTransform = new BABYLON.TransformNode("triggerTransform");
    var triggerBody = new BABYLON.PhysicsBody(triggerTransform, BABYLON.PhysicsMotionType.STATIC, false, scene);
    triggerBody.shape = triggerPhys;
    triggerMesh.position = posiTriger;

    let pftime = null;
    physicsPlugin.onTriggerCollisionObservable.add((ev) => {
        // console.log(ev.type, ':', ev.collider.transformNode.name, '-', ev.collidedAgainst.transformNode.name);
        if (ev.type === 'TRIGGER_ENTERED' && ev.collider.transformNode.name === 'my') {
            gcariframe1 = -1;
            gcariframe2 = -1;
            gcariframe3 = -1;
            if (pftime != null) {
                let pftimeEnd = performance.now();
                timeCur = Math.floor(pftimeEnd-pftime)/1000;
                console.log("\ntime=",timeCur);
                if (timeBest == null) {
                    timeBest = timeCur
                } else if (timeBest > timeCur) {
                    timeBest = timeCur;
                }
                dispTime(timeCur, timeBest);
            }
            if (bOnRecord && bGhostEnable && gcarPosiList.length > 0) {
                if (gcarPosiList1.length == 0) {
                    gcarPosiList1 = gcarPosiList;
                } else if (gcarPosiList.length >= 2000) {
                    if (gcarPosiList3.length > gcarPosiList.length) {
                        gcarPosiList3 = gcarPosiList;
                    } else if (gcarPosiList1.length < 2000) {
                        gcarPosiList1 = gcarPosiList;
                    }
                }
                if (gcarPosiList3.length < gcarPosiList2.length) {
                    [gcarPosiList3, gcarPosiList2] = [gcarPosiList2, gcarPosiList3];
                }
                if (gcarPosiList2.length < gcarPosiList1.length) {
                    [gcarPosiList2, gcarPosiList1] = [gcarPosiList1, gcarPosiList2];
                }
                if (gcarPosiList3.length < gcarPosiList2.length) {
                    [gcarPosiList3, gcarPosiList2] = [gcarPosiList2, gcarPosiList3];
                }
                gcarPosiList = [];
            }
            bOnRecord = false; // 記録停止

        } else if (ev.type === 'TRIGGER_EXITED' && ev.collider.transformNode.name === 'my') {
            pftime = performance.now();
            bOnRecord = true; // 記録開始
            if (gcarPosiList1.length > 0) {
                gcariframe1 = gcarPosiList1.length-1;
            }
            if (gcarPosiList2.length > 0) {
                gcariframe2 = gcarPosiList2.length-1;
            }
            if (gcarPosiList3.length > 0) {
                gcariframe3 = gcarPosiList3.length-1;
            }
        }
    });

    // 左上に使い方（操作方法）を表示
    //   キー操作(h)で表示のon/offを切り替え(上記で)
    let advancedTexture = BABYLON.GUI.AdvancedDynamicTexture.CreateFullscreenUI("UI");
    let guiLabelRect = new BABYLON.GUI.Rectangle();
    guiLabelRect.adaptWidthToChildren = true;
    guiLabelRect.height = "160px";
    guiLabelRect.cornerRadius = 5;
    guiLabelRect.color = "Orange";
    guiLabelRect.thickness = 4;
    guiLabelRect.background = "green";
    advancedTexture.addControl(guiLabelRect);    
    let guiText1 = new BABYLON.GUI.TextBlock();
    guiText1.text = "Usage:\n(W,S) or (Arrow UP/DOWN): forward/back\n(A,D) or (Arrow Left/Right): turn Left/Right\nR: Reset posture\n(Space): Jump\nC: change Camera\nM: change mode(grip/drift/slippy)\nG: ghost view\nH: show/hide this message";
    guiText1.color = "white";
    guiText1.width = "260px";
    guiText1.fontSize = 12;
    guiText1.textWrapping = BABYLON.GUI.TextWrapping.WordWrap;
    guiText1.textHorizontalAlignment = BABYLON.GUI.TextBlock.HORIZONTAL_ALIGNMENT_LEFT;
    guiText1.paddingLeft = 12;
    guiLabelRect.addControl(guiText1);    
    guiLabelRect.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_LEFT;
    guiLabelRect.verticalAlignment = BABYLON.GUI.Control.VERTICAL_ALIGNMENT_TOP;

    // 中央上部にタイムを表示
    let timeCur = 0;
    let timeBest = null;
    let advancedTexture2 = BABYLON.GUI.AdvancedDynamicTexture.CreateFullscreenUI("UI");
    let guiLabelRect2 = new BABYLON.GUI.Rectangle();
    guiLabelRect2.adaptWidthToChildren = true;
    guiLabelRect2.height = "40px";
    guiLabelRect2.cornerRadius = 5;
    guiLabelRect2.color = "Blue";
    guiLabelRect2.thickness = 4;
    guiLabelRect2.background = "Black";
    advancedTexture2.addControl(guiLabelRect2);    
    let guiText2 = new BABYLON.GUI.TextBlock();
    guiText2.text = timeCur.toFixed(3).padStart(7,' ');
    guiText2.color = "white";
    guiText2.width = "100px";
    guiText2.fontSize = 12;
    guiText2.textWrapping = BABYLON.GUI.TextWrapping.WordWrap;
    guiText2.textHorizontalAlignment = BABYLON.GUI.TextBlock.HORIZONTAL_ALIGNMENT_LEFT;
    guiText2.paddingLeft = 12;
    guiLabelRect2.addControl(guiText2);    
    guiLabelRect2.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_CENTER;
    guiLabelRect2.verticalAlignment = BABYLON.GUI.Control.VERTICAL_ALIGNMENT_TOP;

    function dispTime(timeCur, timeBest) {
        if (timeBest == null) {
            guiText2.text = timeCur.toFixed(3).padStart(7,' ');
        } else {
            guiText2.text = timeCur.toFixed(3).padStart(7,' ') + "\n" + timeBest.toFixed(3).padStart(7,' ') + " (best)";
        }
    }
    dispTime(timeCur, timeBest);

    return scene;
};

/*
【JavaScript】Number型の配列をFloat32Arrayへ変換して、バイナリのままbase64で保存【データ圧縮】
https://qiita.com/ML081/items/a0f97af022613410138e
*/

function arrayToFloat16Array(array) {
    const f16 = new Float16Array(array.length);
    array.forEach(function(elm, i) {
	f16[i] = elm;
    });
    return f16;
}

function arrayToFloat32Array(array) {
    const f32 = new Float32Array(array.length);
    array.forEach(function(elm, i) {
	f32[i] = elm;
    });
    return f32;
}

function float32ArrayToBase64(f32) {
    var uint8 = new Uint8Array(f32.buffer);
    return btoa(uint8.reduce(function(data, byte) {
        return data + String.fromCharCode(byte);
    }, ''));
}

function base64ToFloat32Array(base64) {
    var binary = atob(base64),
    len = binary.length,
    bytes = new Uint8Array(len),
    i;
    for(i = 0; i < len; i += 1) {
        bytes[i] = binary.charCodeAt(i);
    }
    return new Float32Array(bytes.buffer);
}

function base64ToFloat16Array(base64) {
    var binary = atob(base64),
    len = binary.length,
    bytes = new Uint8Array(len),
    i;
    for(i = 0; i < len; i += 1) {
        bytes[i] = binary.charCodeAt(i);
    }
    return new Float16Array(bytes.buffer);
}

